import React, { Component, Fragment } from 'react'
import NewPaymentMethod from '../editUser/suscription/paymentMethods/editingForm'
import Premium from 'shared/premium'
import { toggleBannerModal, modalPlans } from '../viewInvoice/utilsRestrictions'

export default class PayPremium extends Component {
  constructor () {
    super()
    this.state = {
      showBannerModal: false
    }
  }

  render () {
    return (
      <Fragment>
        <div className='premium'>
          <div className='premium__card'>
            <NewPaymentMethod
              premium
              controlPlans={() => toggleBannerModal(this, '', true)}
            />
          </div>
          <div className=' premium__card'>
            <Premium />
          </div>
        </div>
        {modalPlans(this)}
      </Fragment>
    )
  }
}
